import styled from "styled-components";


export const Wrapper = styled.div `
	font-size: 1em;
	height: 100vh;
	width: 100vw;
	text-align: center;

`;

export const Content = styled.div `
	display:flex;
	flex-direction: row;
	width: 100vw;
	height: 100vh;
	background-color: #3776ab;

`;

export const WelcomeMessage = styled.div `
	width: 20px;
	height: 10px;
	border: 2px solid black;
`;
